import React from 'react';
import './Home.css';

import Nav from './Nav.js'
import About from './About';
import EndProgram from './ETE';
import Why from './Why';



function Home() {
  return (
    <div className='head'>
      <Nav/>
      
      <About/>
      <EndProgram/>
      <Why/>     
      <div className='mains'>
    <Link to="/KGF2" > <Card no={1} name="KGF 2" img="/asset/image/kgf.jpg"/></Link>
   <Link to="/RRR"> <Card no={2} name="RRR" img="/asset/image/r.jpg" /></Link>
    <Link to="/BAHUBALI"><Card no={3} name="BAHUBALI 2"img="/asset/image/bb.jpg" /></Link>

    </div>

    </div>

    
      
    
      
  )

}

export default Home
